import { MDBContainer,MDBRow, MDBCol} from 'mdbreact'
import React, { Component } from 'react'
import Content from './Content';

export default class Footer extends Component {
    render() {
        return (
            <div>
                <MDBContainer>
                    <MDBRow>
                        <MDBCol className="mb-4 mb-md-0">
                            <Content/>
                        </MDBCol>
                    </MDBRow>
                </MDBContainer>
            </div>
        )
    }
}
